import { Laptop, MailOutline, PhoneAndroid, PhoneInTalk } from "@material-ui/icons";
import React, { useState } from "react";
import agent1 from './img/agent1.jpg';
import agent3 from './img/agent3.jpg';
import agent4 from './img/agent4.jpg';
import "./AgentProfiles.css";

function AgentProfiles(props) {
  return (
    <div className="agent_profile">
      <div className="agent_profile_flex">
        <div className="ap_primary_left">
            <div className="appl_top">
                <img src={props.AgentImg} alt="" />
            </div>
            <div className="agent_info_top">
            <h1>{props.agentName}</h1>
            <p className="agent_position">Real Estate Agent</p>
            <div className="agent_icons_top">
              <a href="tel:1234561234"><PhoneInTalk />(123)-456-1234</a>
              <a href="tel:1234561234"><PhoneAndroid />(123)-456-1234</a>
              <a href="mailto:example@gmail.com"><MailOutline />example@gmail.com</a>
              <a href="#!"><Laptop />www.website.com</a>
            </div>
            </div>
            
        </div>
        <div className="ap_primary_right">

        </div>
      </div>
    </div>
  );
}

export default AgentProfiles;
